    const dispatch = useAppDispatch()
    const {error, loading, blogs, count} = useAppSelector(state => state.blog)

    useEffect(() => {
        dispatch(fetchBlogs())
        console.log(blogs)
    }, [])

    return (
        <>
            { blogs }
        </>
    )
}
